import React, { useEffect, useState } from "react";
import {  Switch, Link, NavLink } from "react-router-dom";
import AddOrganization from './AddOrganization';
import OrganizationList from './OrganizationList';
import { Route } from "react-router";
import { BrowserRouter } from "react-router-dom";
import Organization from "./Organization";
import Restriction from "./Restriction";
import Booking from "./Booking";
import Database from "./Database";
import Company from "./Company";
import Quest from "./Quest";

function Services(props){
    
    
    
    
    return (
        <BrowserRouter>
            <div >
                <nav>
                    <div >
                        <ul >
                            
                            <li className="nav-item">
                                <Link to={'./Company'} className="nav-link">Company</Link>
                            </li>
                            <li className="nav-item">
                                <Link to={'./Quest'} className="nav-link">Quest</Link>
                            </li>
                            <li className="nav-item">
                                <Link to={'./Booking'} className="nav-link">Booking</Link>
                            </li>
                            <li className="nav-item">
                                <Link to={'./Database'} className="nav-link">Database</Link>
                            </li>
                        </ul>
                    </div>
                </nav>
                <br></br>
                <Switch>
                    <Route path="/Company" render={() => <Company />} />
                    <Route path="/Quest" render={() => <Quest/>}/>
                    {/*<Route path="/Restriction" render={() => <Restriction />} />*/}
                    {/*<Route path="/Feedback" render={() => <Feedback />} />*/}
                    {/*<Route path="/Database" render={() => <Database />} />*/}


                </Switch>
            </div>
        </BrowserRouter>
    
    )


}

export default  Services;
